import React from "react"
import Header from "./header"

export default function Home(props){
    return (
        <div className="container">
            <Header />         
            <a href="/signup">Sign up</a><br />
            <a href="/login">Log in</a><br />
            <a href="/books">Books</a><br />
            <a href="/cart">Cart</a><br />        
        </div>
    )
}
